    'introtext' => 'Керамзитобетонные блоки, керамзитовые блоки, блоки из керамзита',
    'content' => '<p>«LATERES» Завод вибропрессованных изделий производит керамзитобетонные блоки в широком ассортименте, выпуская следующие основные виды изделий различных габаритных параметров:<br />• полнотелые блоки;<br />• блоки двухпустотные; <br />• блоки трехпустотные;<br />• блоки четырехпустотные;<br />• блоки семипустотные.</p>
<p>Керамзитобетонные блоки изготавливаются на оборудовании марки завода «Стройтехника» РОССИЯ по фирменной технологии производителя, что позволяет осуществлять выпуск в промышленных объемах. Современные технологии обеспечивают возможность создания изделий, обладающих полным спектром всех необходимых функциональных свойств. Не менее важным аспектом является качественное исходное сырье. Для производства керамзитобетонных блоков используются, в частности, бездобавочный портландцемент Д0, очищенный песок и керамзитный гравий фр 5 - 10 мм однородной структуры.</p>
<p>Особенности технологии и преимущества</p>
<p>Керамзитобетонные блоки производятся способом объемного вибропрессования. Для изготовления применяют гранулы керамзита, полученные путем обжига из специальной глины. Использование качественного сырья и современных высокотехнологичных линий позволяет создавать изделия, отвечающие всем требованиям как общеевропейских стандартов, так и отечественного ГОСТ 6133-99.</p>
<p>Керамзитные блоки обладают функциональными характеристиками, обуславливающими множество неоспоримых достоинств перед кирпичом, как керамическим, так и силикатным.</p>
<p>Основными преимуществами являются:</p>
<ul>
<li>небольшая удельная масса, позволяет минимизировать нагрузку на фундамент – возводимая из керамзитобетонных блоков кладка более чем вдвое легче кирпичной;</li>
<li>наличие пористой структуры, благодаря которой обеспечивается не только легкость, но и высокие тепло-звукоизоляционные показатели – использовать керамзитобетонные блоки можно в условиях сурового климата и повышенной шумности;</li>
<li>объем каждого из стеновых керамзитобетонных блоков в 7 раз превосходит аналогичный показатель силикатного кирпича, что экономически выгодно, так как ускоряет возведение кладки.</li>
</ul>
<p>Применение керамзита способствует эффективному решению сразу нескольких задач. Пустоты минимизируют вес блоков, а естественные звукоизоляционные и теплоизоляционные свойства керамзита в полной мере передаются строительному материалу в целом, а значит, и непосредственно возводимым объектам.</p>
<p>Выпускаемые нами керамзитоблоки безопасны в экологическом плане, прочны, надежны, долговечны, не боятся высоких и низких температур, целиком оправдывая себя экономически на всех этапах строительства и эксплуатации объектов.</p>
